@leqiao-1 can you use the latest ONNX Runtime version: 1.7.0 version and not the 1.6.0 version and follow the same steps.
There was one bug with python API on windows with ONNXRuntime 1.6.0 release. we had it fixed with ONNXRuntime 1.7.0 release. You should probably be able to build and run successfully with ONNXRuntime 1.7.0.

you can use any OpenVINO version (2021.1 also is fine), but if possible, I would recommend you to use the latest OpenVINO 2021.3 Release installation on windows.

@leqiao-1 I was able to see the same error at the end. This is happening when it tries to run the unit tests automatically once the build is complete. As you see, all the unit tests are passing fine (0 tests failed out of 6 test suite) and so it  looks like there's some issue when it's about to exit while it is trying to run onnxruntime_test_python.py

However you can ignore it for now. The build is anyways successful, you can now navigate down to
cd onnxruntime/build/windows/Release/Release and start experimenting with built in c++ and python applications that comes with onnxruntime (or) you can start writing your own c++ or python application and try executing them.
